import "./UserDatas.css";
import React, { Fragment, useState } from "react";



// inputvalue,change value and in usestate value print in console
const[modelPost,showPost]= useState({
userId:'',
id:'',
title:'',
body:''
})

 const showUserPost = async (e) => {  
    const id = e.target.id ; 
    await fetch(`https://jsonplaceholder.typicode.com/posts?userId=${id}`)
      .then((res) => res.json())
      .then((data) => showPost(data))
      .catch((err) => {
        console.log(err);
      });
  };



const UserDatas = (props) => {
//   console.log(typeof props.userdata);
//   console.log(props.userdata[0]);
//   console.log(Object.values(props.userdata));

  return (
    <>


    <span className="title">User Datas</span>

  <table className="table">
     <tr className="tr">
        <th className="td">Id</th>
        <th className="td">Name</th>
        <th className="td">Email</th>
        <th className="td">Phone</th>
        <th className="td">Address</th>
        <th className="td">Views</th>
    </tr>


      {props.userdata.map((user,index) => {
        {/* console.log(user.address); */}
        return (
          <Fragment key={index}>

            <tr className="tr">
              <td className="td">{user.id}</td>
              <td className="td">{user.name}</td>
              <td className="td">{user.email}</td>
              <td className="td">{user.phone}</td>
              <td className="td">
                {user.address.street},{user.address.suite},{user.address.city},
                {user.address.zipcode}
              </td>
              <td><button id={user.id} onClick={showUserPost}>Views</button> 
</td>
            </tr>

          </Fragment>

        );
      }
       )}

       <p>{modelPost}</p>
        </table>
    </>
  );
};

export default UserDatas;
